import React from 'react'
import styled from 'styled-components';

const Box = styled.div`
    margin: 56px;
    display:flex;
    flex-direction: column;
    width: 80%;
    height: auto;
    border: 1px solid red;
    border-radius: 12px;
`

const Container = ({ children }) => {
  return (
    <Box>{children}</Box>
  )
}

export default Container
